discapacidad','Número de grupos de la diversidad sexual, personas con discapacidad, grupos étnicos y pueblos indígenas que realizan acciones de prevención de la violencia basada en género','grupos-div-sexual-y-discapacidad'),(14,4,'Grupos etnico, indigenas y jovenes','Número y tipo de acciones específicas que promueven una masculinidad libre de prejuicios y violencia','grupos-etnico-indigenas-y-jovenes'),(15,5,'Servicios de atención','Número de casos atendidos por las organizaciones contrapartes del FED a través de los servicios de atención en salud, psicológica y legal para víctimas de violencia.','servicios-de-atencion'),(16,5,'Denuncias interpuestas','Número de denuncias interpuestas por las victimas de violencia en las instancias que administran justicia como producto de las acciones de las organizaciones de la sociedad civil apoyadas por el FED.','denuncias-interpuestas'),(17,5,'Victimas atendidas','Número de mujeres atendidas en los albergues apoyados por el FED como instrumento para la construcción de nuevos proyectos de vida','victimas-atendidas'),(18,5,'Referencias y contrareferencias','Número de referencia y contrareferencia que realizan las CP del FED con instituciones públicas.','referencias-y-contrareferencias'),(19,6,'Intercambio teórico y metod.','Número de acciones que promueven el intercambio teórico y metodológico para la gestión de conocimientos entre las OSC.','intercambio-teorico-y-metod'),(20,6,'Medir y reportar indicadores','Número de acciones que fortalecen las capacidades de las organizaciones para medir y reportar los indicadores propuestos.','medir-y-reportar-indicadores'),(21,6,'Mejorar la gestion','Porcentaje y número de organizaciones que mejoran sus capacidades administrativas y de gestión.','mejorar-la-gestion');
