INSERT INTO `encuesta_organizacion` VALUES (6,'Puntos','Bolonia. Rotonda El Gueguense, 4c abajo, 1c lago ','puntos@puntos.org.ni','Martha Juárez ','(505) 22681227','Puntos surgió de la reflexión de un grupo de mujeres feministas....','Puntos de Encuentro '),(7,'FECONORI','De Optica Nicaraguense 1 c arriba 1 c al sur','generofeconori01@yahoo.es','Rigoberto Kingsing Miranda',' (505) 2268-1567','La FECONORI es una entidad social sin fines de lucros, no gubernamental, pluralista, apartidista y sin credo religioso, que vela por los derechos y promueve la inclusión de las personas con Discapacidad en todos los ámbitos.\r\n','Federacion de asociaciones de personas con discapacidad.'),(8,'CANTERA','De Plaza el Sol, 2c al sur, 1 cuadra arriba.','lnc71@yahoo.com','Linda Nùñez Calderòn','505 - 22780103','CANTERA es una organización nicaragüense no gubernamental, de tipo humanitario, sin fines de lucro y con personería jurídica propia. La institución está al servicio del desarrollo integral de los sectores populares del campo y la ciudad.  \r\nCantera fue fundada en el año 1988. Cuenta con acta de fundación y estatutos aprobados por el gobierno de Nicaragua. \r\nCantera es miembro de la Coordinación Centroamericana de Educación Popular Alforja, del Consejo de Educación de Adultos de América Latina (CEAAL) y de la Federación de Organismos No Gubernamentales de Nicaragua. También participa de diversas redes, tanto nacionales como regionales, relacionadas con el trabajo de los distintos programas que se desarrollan en el Centro.\r\n*Contribuir al desarrollo de la conciencia crítica, la capacidad de análisis, la innovación y el compromiso social de los sectores a quienes acompañamos para la transformación de su realidad.\r\n*  Documentar, sistematizar y divulgar a nivel local y regional, metodologías de trabajo que inciden en el desarrollo integral.\r\n* Fortalecer la organización interna, los mecanismos de comunicación y la capacidad de incidencia a través de la búsqueda de sostenibilidad y la participación en redes e instancias que promuevan el cambio social, político y económico de los sectores marginados.\r\ncanteranicaragua.org\r\n','CANTERA (CENTRO DE COMUNICACION Y EDUCACION POPULAR)'),(9,'CCBN','De donde fue la Embajada EEUU 1 cuadra al oeste, 3 cuadras al norte, 1 cuadra al Oeste. Bo. Batahola Norte. Managua','darling.proyectofed.ccbn@gmail.com','Darling Munguía García','0050522504542','La Asociación Centro Cultural Batahola Norte (CCBN) es un centro comunitario de educación y arte, fundado en 1983 para acompañar a las mujeres, niños y niñas de los barrios populares y marginados de Managua en su búsqueda de nuevas y más dignas formas de vida.  Tiene como misión “Vivir un estilo de vida más fraterna y justa, según el Evangelio y partiendo de los pobres, a través de la educación integral y la cultura que hacen descubrir: los Derechos Humanos, la Autoestima y la Igualdad. Creemos en el empoderamiento de las personas y en el valor de compartir lo que somos y lo que tenemos, para transformar esta sociedad en el Reino de Dios.”','Asociacion Centro Cultural Batahola Norte');
/*!40000 ALTER TABLE `encuesta_organizacion` ENABLE KEYS */;
UNLOCK TABLES;

